  // },
  typography: {
    fontFamily: "Ubarnist",
  },
});
function App() {
  return (
    <ThemeProvider theme={customTheme}>
      {/* <Home /> */}
      {/* <ProductList /> */}
      {/* <ProductDetails /> */}
      <Login />
      <Register />
      <Cart />
    </ThemeProvider>
  );
}

export default App;
